import {
  AfterViewInit,
  Component,
  ElementRef,
  Inject,
  ViewChild,
} from '@angular/core';
import { MAT_DIALOG_DATA } from '@angular/material/dialog';
import { fabric } from 'fabric';
import { log } from 'fabric/fabric-impl';

@Component({
  selector: 'app-upload-artwork-dialog',
  templateUrl: './upload-artwork-dialog.component.html',
  styleUrls: ['./upload-artwork-dialog.component.scss'],
})
export class UploadArtworkDialogComponent implements AfterViewInit {
  @ViewChild('fileInput') fileInput!: ElementRef<HTMLInputElement>;
  constructor(@Inject(MAT_DIALOG_DATA) public data: any) {}
  scaledImage: any;
  canvas!: fabric.Canvas;

  ngAfterViewInit(): void {
    this.canvas = new fabric.Canvas('canvas');
    // this.importJsonToCanvas();
  }

  handleFileInput(event: Event): void {
    const fileList: any = (event.target as HTMLInputElement).files;

    if (fileList.length > 0) {
      const file: File = fileList[0];
      const reader: FileReader = new FileReader();

      reader.onload = (e: ProgressEvent<FileReader>) => {
        const imageUrl: string = e.target?.result as string;

        fabric.Image.fromURL(imageUrl, (image: any) => {
          const canvasWidth = this.canvas.getWidth();
          const canvasHeight = this.canvas.getHeight();
          const imageAspectRatio = image.width / image.height;
          const canvasAspectRatio = canvasWidth / canvasHeight;
          let scaleFactor;

          if (imageAspectRatio > canvasAspectRatio) {
            // Image is wider than the canvas
            scaleFactor = canvasWidth / image.width;
          } else {
            // Image is taller or has the same aspect ratio as the canvas
            scaleFactor = canvasHeight / image.height;
          }

          this.scaledImage = new fabric.Image(image.getElement(), {
            left: 0,
            top: 0,
            scaleX: scaleFactor,
            scaleY: scaleFactor,
          });

          this.canvas.add(this.scaledImage);
        });
      };

      reader.readAsDataURL(file);
    }
  }

  saveCanvasView(): void {
    const json = JSON.stringify(this.canvas.toJSON());
    console.log(json);
  }

  importJsonToCanvas(): void {
    this.canvas.loadFromJSON(
      {
        version: '5.3.0',
        objects: [
          {
            type: 'image',
            version: '5.3.0',
            originX: 'left',
            originY: 'top',
            left: 35,
            top: 35,
            width: 1000,
            height: 1500,
            fill: 'rgb(0,0,0)',
            stroke: null,
            strokeWidth: 0,
            strokeDashArray: null,
            strokeLineCap: 'butt',
            strokeDashOffset: 0,
            strokeLineJoin: 'miter',
            strokeUniform: false,
            strokeMiterLimit: 4,
            scaleX: 0.13,
            scaleY: 0.13,
            angle: 0,
            flipX: false,
            flipY: false,
            opacity: 1,
            shadow: null,
            visible: true,
            backgroundColor: '',
            fillRule: 'nonzero',
            paintFirst: 'fill',
            globalCompositeOperation: 'source-over',
            skewX: 0,
            skewY: 0,
            cropX: 0,
            cropY: 0,
            src: 'data:image/webp;base64,',
            crossOrigin: null,
            filters: [],
          },
        ],
      },
      () => {
        this.canvas.renderAll();
      }
    );
  }
}
